import { TextField, withStyles } from '@material-ui/core';
import React,{useEffect, useState} from 'react';

const initialFeedValues = {
    title:'',
    message:''
}

const styles = theme =>({
    root: {
        '& .MuiTextField-root': {
            margin: theme.spacing(1),
            width: 200
        }
    }
})

const BlogMessageForm = (props) => {
    const [values, setValues] = useState(initialFeedValues)

    return(
        <form autoComplete="off" noValidate>
            <TextField name="title" variant="outlined" label="Title" fullWidth value={values.title} />
            <TextField name="message" variant="outlined" label="Message" fullWidth value={values.message} />
        </form>
    );
}

export default BlogMessageForm;
